;(function($, window, document, undefined) {

  'use strict';

  var requestAnimationFrame = window.requestAnimationFrame || window.mozRequestAnimationFrame ||
                              window.webkitRequestAnimationFrame || window.msRequestAnimationFrame;
  window.requestAnimationFrame = requestAnimationFrame;

  var pluginName = 'vago';

  function getLuminance(r, g, b) {
    return (0.2126 * r + 0.7152 * g + 0.0722 * b) / 255;
  }

  function cloneArray(a) {
    var b = [];

    for (var i = 0; i < a.length; i++) {
      if (a[i]) {
        b[i] = a[i].slice();
      }
    }

    return b;
  }

  function getRandomColor() {
    var r;
    var g;
    var b;

    r = Math.floor(Math.random() * 255);
    g = Math.floor(Math.random() * 255);
    b = Math.floor(Math.random() * 255);

    return [r, g, b];
  }

  function Vago(element, options) {

    var defaults = {
      background: null,
      color: null,
      points: null,
      windowSize: 1,
      maxRadius: null,
      degradationLevel: 0.3,
      stepByStep: false,
      addTitle: true,
    };

    this.getRadius = function(matrix, x, y) {
      if (x < 0 || x >= this.maxX) {
        return null;
      }

      if (y < 0 || y >= this.maxY) {
        return null;
      }

      if (!matrix[x]) {
        return null;
      }

      if (!matrix[x][y]) {
        return null;
      }

      return matrix[x][y];
    };

    this.canvasToCircles = function(canvas) {
      var ctx = canvas.getContext('2d');
      var radius = this.settings.maxRadius;
      var windowSize = radius * 2;
      var row = 0;
      var column = 0;
      var i;
      var j;
      var wI;
      var wJ;
      var rmI;
      var rmJ;
      var averageLuminance;
      var radiusMatrix = [];
      var matrix = [];

      var imageData = ctx.getImageData(0, 0, canvas.width, canvas.height);
      var iData = imageData.data;

      for (i = 0; i < iData.length; i += 4) {
        if (!matrix[row]) {
          matrix[row] = [];
        }

        matrix[row][column] = getLuminance(iData[i], iData[i + 1], iData[i + 2]);

        column++;
        if (column >= canvas.width) {
          row++;
          column = 0;
        }
      }

      rmI = 0;
      for (i = radius; i < (matrix.length - radius); i = i + windowSize) {
        rmJ = 0;
        for (j = radius; j < (matrix[i].length - radius); j = j + windowSize) {
          averageLuminance = 0;
          for (wI = -radius; wI <= radius; wI++)  {
            for (wJ = -radius; wJ <= radius; wJ++) {
              averageLuminance += matrix[i + wI][j + wJ];
            }
          }

          averageLuminance = averageLuminance / (Math.pow(windowSize, 2));

          if (!radiusMatrix[rmJ]) {
            radiusMatrix[rmJ] = [];
          }
          radiusMatrix[rmJ][rmI] = Math.max(1, (1 - averageLuminance) * radius);

          rmJ++;
        }
        rmI++;
      }

      return radiusMatrix;
    };

    this.pointToPixel = function(p){
      return this.settings.maxRadius * 2 * p;
    };

    this.initCanvas = function() {
      var auxCanvas;
      var auxCtx;

      auxCanvas = document.createElement('canvas');
      auxCanvas.width = this.canvas.width;
      auxCanvas.height = this.canvas.height;
      auxCtx = auxCanvas.getContext('2d');

      auxCtx.fillStyle = 'white';
      auxCtx.fillRect(0, 0, this.canvas.width, this.canvas.height);
      auxCtx.fillStyle = 'black';

      return auxCanvas;
    };

    this.textInCanvas = function(text, name) {
      var auxCanvas;
      var auxCtx;

      auxCanvas = this.initCanvas();
      auxCtx = auxCanvas.getContext('2d');
      auxCtx.textAlign = 'center';
      auxCtx.textBaseline = 'middle';
      auxCtx.font = 'bold 300px Helvetica';
      auxCtx.fillText(text, auxCanvas.width / 2, auxCanvas.height / 2);

      this.shapes[name] = this.canvasToCircles(auxCanvas);
    };

    this.areaInCanvas = function(a, b, c, d, canvas) {
      var auxCanvas = canvas;
      var auxCtx;

      if (!auxCanvas) {
        auxCanvas = this.initCanvas();
      }
      auxCtx = auxCanvas.getContext('2d');
      auxCtx.beginPath();
      auxCtx.moveTo(a[0], a[1]);
      auxCtx.lineTo(b[0], b[1]);
      auxCtx.lineTo(c[0], c[1]);
      auxCtx.lineTo(d[0], d[1]);
      auxCtx.fill();

      return auxCanvas;
    };

    this.imageInCanvas = function(src, name) {
      var auxCanvas;
      var auxCtx;
      var img = new Image();
      var _this = this;

      img.src = src;
      auxCanvas = this.initCanvas();
      auxCtx = auxCanvas.getContext('2d');
      img.onload = function() {
        auxCtx.drawImage(img, (auxCanvas.width - img.width) / 2, (auxCanvas.height - img.height) / 2) ;
        _this.shapes[name] = _this.canvasToCircles(auxCanvas);
      };
      _this.shapes[name] = _this.canvasToCircles(auxCanvas);
    };

    this.element = element;
    this._defaults = defaults;
    this._name = pluginName;

    this.settings = $.extend({}, defaults, options);

    if (!this.settings.background) {
      this.settings.background = getRandomColor();
    }

    if (!this.settings.color) {
      this.settings.color = getRandomColor();
    }

    if (!this.settings.points) {
      this.settings.points = Math.floor(Math.random() * 3) + 1;
    }

    this.init();
  }

  $.extend(Vago.prototype, {
    logSettings: function() {
      var p;

      for (p in this.settings) {
        if (p === 'background' || p === 'color') {
          console.log(p + ' : %c' + this.settings[p], 'color: ' + this.settings[p]);
        } else {
          console.log(p, ':', this.settings[p]);
        }
      }
    },

    init: function() {

      var _this = this;

      this.canvas = this.element;

      if (!this.settings.maxRadius) {
        this.settings.maxRadius = Math.floor(Math.max(this.canvas.width, this.canvas.height) / 100);
      }

      this.maxX = Math.floor(this.canvas.width / (this.settings.maxRadius * 2));
      this.maxY = Math.floor(this.canvas.height / (this.settings.maxRadius * 2));
      this.matrix = [];
      this.circles = [];

      this.logSettings();

      var auxCanvas;
      var auxCtx;
      var auxPath;

      this.colorMode = 'soft';
      this.colorCicle = 0;
      this._lastColorDraw = 0;
      this.shapeMode = 'random';
      this._lastShapeDraw = 0;

      this.shapes = {};

      auxCanvas = this.initCanvas();
      auxCtx = auxCanvas.getContext('2d');
      auxCtx.fillRect( Math.floor((this.canvas.width - this.pointToPixel(15)) / 2), Math.floor((this.canvas.height - this.pointToPixel(15)) / 2), this.pointToPixel(15), this.pointToPixel(15));
      this.shapes.square = this.canvasToCircles(auxCanvas);

      auxCanvas = this.initCanvas();
      auxCtx = auxCanvas.getContext('2d');
      auxPath = new Path2D();
      auxPath.arc( (this.canvas.width - this.pointToPixel(10)) / 2 + this.pointToPixel(5), (this.canvas.height - this.pointToPixel(10)) / 2 + this.pointToPixel(5), this.pointToPixel(10), 0, 2 * Math.PI );
      auxCtx.fill(auxPath);
      this.shapes.circle = this.canvasToCircles(auxCanvas);

      this.imageInCanvas(
        'data:image/jpeg;base64,',
        'moustache'
      );

      this.imageInCanvas(
        'data:image/jpeg;base64,',
        'autobahn'
      );

      // this.imageInCanvas(
      //   'data:image/jpeg;base64,',
      //   'tomada'
      // );

      this.imageInCanvas(
        'data:image/jpeg;base64,',
        'shit'
      );

      this.textInCanvas('YEAH!', 'yeah');
      this.textInCanvas('BOING!', 'boing');
      this.textInCanvas('BOOM!', 'boom');
      this.textInCanvas('TSCHAK!', 'tschak');
      this.textInCanvas('AH!', 'ah');
      this.textInCanvas('ERROR', 'error');
      this.textInCanvas('?', 'pregunta');
      this.textInCanvas('ASÍ NO', 'asino');
      //this.textInCanvas('o_O', 'cara');

      this.draw();
    },

    iterate: function() {
      var auxMatrix = cloneArray(this.matrix);
      var i = 0;
      var j = 0;
      var maxX = this.maxX;
      var maxY = this.maxY;

      for (j = 0; j < maxY; j = j + 1) {
        for (i = 0; i < maxX; i = i + 1) {

          if (!auxMatrix[i]) {
            auxMatrix[i] = [];
          }

          if (!auxMatrix[i][j]) {
            auxMatrix[i][j] = 1;
          }

          if (this.shapeMode == 'random') {
            auxMatrix[i][j] = auxMatrix[i][j] + (Math.random() * 2 - 1);
          } else {
            if (auxMatrix[i][j] > this.shapes[this.shapeMode][i][j]) {
              auxMatrix[i][j] = auxMatrix[i][j] - 0.25;
            } else {
              auxMatrix[i][j] = auxMatrix[i][j] + 0.25;
            }
          }

          auxMatrix[i][j] = Math.min(this.settings.maxRadius, Math.max(1, auxMatrix[i][j]));
        }
      }

      this.matrix = cloneArray(auxMatrix);

      if (!this.colorCicle) {
        // this.settings.background[0] = Math.round( Math.min(255, Math.max(1, this.settings.background[0] + (Math.random() * 10 - 5))) );
        // this.settings.background[1] = Math.round( Math.min(255, Math.max(1, this.settings.background[1] + (Math.random() * 10 - 5))) );
        // this.settings.background[2] = Math.round( Math.min(255, Math.max(1, this.settings.background[2] + (Math.random() * 10 - 5))) );

        this.settings.color[0] = Math.round( Math.min(255, Math.max(1, this.settings.color[0] + (Math.random() * 10 - 5))) );
        this.settings.color[1] = Math.round( Math.min(255, Math.max(1, this.settings.color[1] + (Math.random() * 10 - 5))) );
        this.settings.color[2] = Math.round( Math.min(255, Math.max(1, this.settings.color[2] + (Math.random() * 10 - 5))) );
      }
    },

    draw: function() {
      var _this = this;

      this.colorCicle = (this.colorCicle + 1) % 5;

      if (_this.colorMode == 'soft') {
        if (Math.random() > 0.999) {
          _this.colorMode = 'hard';
          _this._lastColorDraw = 0;
        }
      } else {
        _this._lastColorDraw++;
        if (_this._lastColorDraw > 50) {
          _this.colorMode = 'soft';
        }
      }

      if (_this.shapeMode == 'random') {
        if (Math.random() > 0.999) {
          var sh = Object.keys(this.shapes);
          _this.shapeMode = sh[ sh.length * Math.random() << 0 ];
          _this._lastShapeDraw = 0;
        }
      } else {
        _this._lastShapeDraw++;
        if (_this._lastShapeDraw > 100) {
          _this.shapeMode = 'random';
        }
      }

      //_this.shapeMode = 'shit';

      _this.iterate();
      _this.stepDraw();

      requestAnimationFrame(function() {
        _this.draw();
      });
    },

    stepDraw: function() {

      var radius;
      var i;
      var j;
      var ctx = this.canvas.getContext('2d');
      var path;
      var x;
      var y = this.settings.maxRadius;

      ctx.fillStyle = 'rgb(' + this.settings.background.join() + ')';
      ctx.fillRect(0, 0, this.canvas.width, this.canvas.height);

      if (this.colorMode == 'soft') {
        ctx.fillStyle = 'rgb(' + this.settings.color.join() + ')';
      }

      for (j = 0; j < this.maxY; j = j + 1) {
        x = this.settings.maxRadius;

        for (i = 0; i < this.maxX; i = i + 1) {

          radius = this.getRadius(this.matrix, i, j);
          radius = radius ? radius : 1;

          if (this.colorMode == 'hard') {
            ctx.fillStyle = 'rgb(' + getRandomColor().join() + ')';
          }

          path = new Path2D();
          path.arc(x, y, radius, 0, 2 * Math.PI);

          ctx.fill(path);
          x += 2 * this.settings.maxRadius;
        }

        y += 2 * this.settings.maxRadius;
      }
    },
  });

  $.fn[ pluginName ] = function(options) {
    return this.each(function() {
      if (!$.data(this, 'plugin_' + pluginName)) {
        $.data(this, 'plugin_' + pluginName, new Vago(this, options));
      }
    });
  };

})(jQuery, window, document);
